import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


function Iban() {
    const banks = [
      { samaCode: '55', bankName: 'Banque Saudi Fransi', nameEn: 'Banque Saudi Fransi', nameAr: 'البنك السعودي الفرنسي', img: './img/._55.png' },
      { name: 'Alrajhi Bank', samaCode: '80', nameEn: 'Alrajhi Bank', nameAr: 'بنك الراجحي', img: './img/._80.png' },
      { samaCode: '10', bankName: 'National Commercial Bank', nameEn: 'National Commertial Bank', nameAr: 'البنك الأهلي التجاري', img: './img/._10.png' },
      { samaCode: '45', bankName: 'Saudi British Bank', nameEn: 'SABB', nameAr: 'ساب', img: './img/._45.png' },
      { samaCode: '20', bankName: 'Riyadh Bank', nameEn: 'Riyad Bank', nameAr: 'بنك الرياض', img: './img/._20.png' },
      { samaCode: '40', bankName: 'Saudi American Bank', nameEn: 'SAMBA', nameAr: 'سامبا', img: './img/._40.png' },
      { samaCode: '05', bankName: 'Alinma Bank', nameEn: 'AL Inma Bank', nameAr: 'بنك الانماء', img: './img/._05.png' },
      { samaCode: '50', bankName: 'Alawwal bank', nameEn: 'AlAwwal Bank', nameAr: 'البنك الأول', img: './img/._50.png' },
      { samaCode: '60', bankName: 'Bank AlJazira', nameEn: 'Bank Aljazerah', nameAr: 'بنك الجزيرة', img: './img/._60.png' },
      { samaCode: '65', bankName: 'Saudi Investment Bank', nameEn: 'Saudi Investment Bank', nameAr: 'البنك السعودي للأستثمار', img: './img/._65.png' },
      { samaCode: '15', bankName: 'Bank AlBilad ', nameEn: 'BANK ALBELAD', nameAr: 'بنك البلاد', img: './img/._15.png' },
      { samaCode: '30', bankName: 'Arab National Bank', nameEn: 'Arab National Bank', nameAr: 'البنك العربي الوطني', img: './img/._30.png' },
      { samaCode: '90', bankName: 'GULF Bank', sarieCode: 'GULFSARI', nameEn: 'Gulf International Bank', nameAr: 'بنك الخليج', img: './img/._90.png' },
      { samaCode: '95', bankName: 'Emirates Bank', nameEn: 'EMARITE BANK', nameAr: 'بنك الامارات', img: './img/._95.png' },
      { samaCode: '76', bankName: 'Bank Muscat', nameEn: 'Bank Muscat', nameAr: 'بنك مسقط', img: './img/._76.png' },
      { samaCode: '71', bankName: 'National Bank of Bahrain', nameEn: 'National Bank Of Bahrain', nameAr: 'بنك البحرين الوطني', img: './img/._71.png' },
      { samaCode: '75', bankName: 'National Bank of Kuwait', nameEn: 'National Bank of Kuwait', nameAr: 'بنك الكويت الوطني', img: './img/._75.png' },
      { samaCode: '85', bankName: 'BNP Paribas Bank', nameEn: 'BNP PARIBAS SAUDI ARABIA', nameAr: 'بي ان بي باريبوس', img: './img/._85.png' },
    ];
    const [iban, setIban] = useState('');
  const [message, setMessage] = useState('');

  const validateIBAN = (iban) => {
    if (!iban) return false;

    iban = iban.trim();

    if (iban.length !== 24) return false;
    if (!iban.startsWith('SA')) return false;

    return true;
  };

  const getBankByIban = (event) => {
    event.preventDefault();
    if (!validateIBAN(iban)) {
      setMessage('Your IBAN is not correct');
    } else {
      const BankCode = iban.substring(4, 6);
      const bank = banks.find((b) => b.samaCode === BankCode);
      if (bank) {
        setMessage(
          <div>
            <p>Your IBAN is correct: {bank.nameAr}</p>
            <img src={bank.img} alt={bank.nameEn} />
          </div>
        );
      } else {
        setMessage('Bank not found');
      }
    }
  };

  return (
    <>
    {banks.img}
      <div className="center">
        <div className="container mt-5">
          <div className="row">
            <div className="col-md-6 offset-md-3">
              <div className="card shadow-lg p-3 mb-5 bg-body rounded">
                <div className="card-header">
                  <h1>IBAN Checker</h1>
                </div>
                <div className="card-body">
                  <form onSubmit={getBankByIban}>
                    <div className="form-group">
                      <label htmlFor="iban">IBAN</label>
                      <input
                        type="text"
                        name="iban"
                        id="iban"
                        className="form-control border-4 border border-secondary"
                        value={iban}
                        onChange={(e) => setIban(e.target.value)}
                      />
                    </div>
                    <div className="form-group">
                      <button type="submit" className="btn btn-primary mt-2">
                        Submit
                      </button>
                    </div>
                  </form>
                  <div id="result" className="mt-3">
                    {message}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Iban;
